// frontend/src/components/Feed.js
import React from 'react';

function Feed({ stories }) {
  return (
    <div className="feed">
      <h2>Task Stories Feed</h2>
      {stories.map(story => (
        <div key={story.id} className="story">
          <p>{story.story_text}</p>
          <small>XP: {story.xp} | Currency: {story.currency}</small>
        </div>
      ))}
    </div>
  );
}

export default Feed;
